    @Test
    fun `parser test - single page`() {
        html = ClassLoader
            .getSystemClassLoader()
            .getResourceAsStream("program_viewer_top_page_single.htm")
            .bufferedReader(charset = Charsets.UTF_16)
            .use(Reader::readText)

        val testInstance = ProgramViewerPageParserV2(html)
        val actual = testInstance.parse()
        val expected = ProgramViewerPage(
            basePostData = mapOf(
                "__EVENTTARGET" to "",
                "__EVENTARGUMENT" to "",
                "__VIEWSTATE" to "",
                "__VIEWSTATEGENERATOR" to "64262183",
                "__PREVIOUSPAGE" to "EmGufi0TjhjUtvCsTSDh5QoLG0iPq24klSisB6UufhunWvcxtPJqMdSL7J3X3m7Z6djXd84mJ7-RgxitNL2qnDWt4zU1",
