                "ctl00\$ContentPlaceHolder1\$viewlink1\$txtTitle" to "2019 KBO 베이스볼 - 2464304595515867152:16",
                "ctl00\$ContentPlaceHolder1\$viewlink1\$txtUrl" to "http://joovideo.net/viewlink.aspx?Num=2464304595515867152"
            ),
            suppliers = listOf(
                supplierOf(
                    "Share-1",
                    "HostLink",
                    "1157835|16|Share-1||0|0"
                ),
                supplierOf(
                    "Share-2",
                    "HostLink",
                    "1157837|16|Share-2||0|0"
                ),
                supplierOf(
                    "VStream-1",
                    "HostLink",
                    "1157838|16|VStream-1||0|0"
                )
            )
        )
        assertEquals(
            actual = actual,
            expected = expected
